import React, { useState, useEffect } from 'react';
import {
  Grid,
  FormControl,
  InputLabel,
  Select,
  MenuItem,
  TextField,
  Button,
  makeStyles,
  Checkbox,
  Paper,
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
} from '@material-ui/core';

const useStyles = makeStyles((theme) => ({
  formControl: {
    margin: theme.spacing(1),
    minWidth: 120,
    width: '100%',
  },
  selectEmpty: {
    marginTop: theme.spacing(2),
  },
  button: {
    margin: theme.spacing(1),
  },
  searchField: {
    margin: theme.spacing(1),
    minWidth: 120,
    width: '100%',
  },
  table: {
    minWidth: 650,
  },
  filterContainer: {
    marginBottom: theme.spacing(3),
  },
  buttonContainer: {
    display: 'flex',
    justifyContent: 'space-between',
    padding: theme.spacing(2),
  },
  csvTable: {
    width: '100%',
  },
}));

const LeftColumn = () => {
  const classes = useStyles();
  const [filter, setFilter] = useState('');
  const [region, setRegion] = useState('');
  const [platform, setPlatform] = useState('TikTok');
  const [promotionType, setPromotionType] = useState('Brand');
  const [data, setData] = useState([]);
  const [race, setRace] = useState('');
  const [gender, setGender] = useState('');
  const [furtherLocation, setFurtherLocation] = useState('');
  const [selectedItems, setSelectedItems] = useState(new Set());
  const [avgViews, setAvgViews] = useState('');

  const handleResetFilters = () => {
    setRegion('');
    setPlatform('TikTok');
    setPromotionType('Brand');
    setRace('');
    setGender('');
    setFurtherLocation('');
    setFilter('');
    setAvgViews('');
  };

  useEffect(() => {
    // Place your data fetching logic here if necessary
  }, []);

  const handleSelectItem = (itemId) => {
    const newSelection = new Set(selectedItems);
    if (newSelection.has(itemId)) {
      newSelection.delete(itemId);
    } else {
      newSelection.add(itemId);
    }
    setSelectedItems(newSelection);
  };

  return (
    <div>
      <Grid container spacing={3}>
        <Grid item xs={12} className={classes.filterContainer}>
          {/* Filters */}
          <FormControl variant="outlined" className={classes.formControl}>
            <InputLabel id="region-label">Region</InputLabel>
            <Select
              labelId="region-label"
              id="region-select"
              value={region}
              onChange={(e) => setRegion(e.target.value)}
              label="Region"
            >
              <MenuItem value=""><em>None</em></MenuItem>
              {/* Add regions here */}
            </Select>
          </FormControl>

          {/* Similar FormControl blocks for platform, promotionType, race, gender, furtherLocation */}

          <TextField
            id="search-field"
            label="Search"
            variant="outlined"
            className={classes.searchField}
            value={filter}
            onChange={(e) => setFilter(e.target.value)}
            fullWidth
          />

          <Button
            variant="contained"
            color="primary"
            onClick={handleResetFilters}
            className={classes.button}
            fullWidth
          >
            Reset Filters
          </Button>
        </Grid>

        <Grid item xs={12}>
          {/* Data Table */}
          <Paper elevation={3}>
            <TableContainer>
              <Table className={classes.table} aria-label="simple table">
                <TableHead>
                  <TableRow>
                    <TableCell>Select</TableCell>
                    {/* Define your table headers here */}
                  </TableRow>
                </TableHead>
                <TableBody>
                  {data.map((row) => (
                    <TableRow key={row.id}>
                      <TableCell padding="checkbox">
                        <Checkbox
                          checked={selectedItems.has(row.id)}
                          onChange={() => handleSelectItem(row.id)}
                          color="primary"
                        />
                      </TableCell>
                      {/* Map other cell data here */}
                    </TableRow>
                  ))}
                </TableBody>
              </Table>
            </TableContainer>
          </Paper>
        </Grid>
      </Grid>
    </div>
  );
};

export default LeftColumn;
